import React, { useState } from 'react';
import {
  Paper,
  Typography,
  List,
  ListItem,
  Card,
  CardContent,
  Box,
  Button,
  Chip,
  Divider,
  Collapse,
  IconButton,
} from '@mui/material';
import { 
  Send as SendIcon, 
  Schedule as ScheduleIcon,
  ExpandMore as ExpandMoreIcon,
  ExpandLess as ExpandLessIcon 
} from '@mui/icons-material';
import XIcon from '../Icons/XIcon';

const ReplyQueue = ({ queuedReplies = [] }) => {
  const [sending, setSending] = useState(new Set());
  const [isOpen, setIsOpen] = useState(true);

  const handleSendReply = async (replyId) => {
    setSending(prev => new Set([...prev, replyId]));
    // TODO: Implement actual sending
    await new Promise(resolve => setTimeout(resolve, 1000));
    setSending(prev => {
      const next = new Set(prev);
      next.delete(replyId);
      return next;
    });
  };

  return (
    <Paper sx={{ 
      p: 3, 
      borderRadius: 2, 
      bgcolor: 'background.paper', 
      height: isOpen ? '85vh' : 'auto', 
      overflow: 'hidden',
      transition: 'height 0.3s ease-in-out'
    }}>
      <Box sx={{ 
        display: 'flex', 
        alignItems: 'center', 
        justifyContent: 'space-between',
        mb: isOpen ? 2 : 0 
      }}>
        <Typography variant="h6" sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
          <ScheduleIcon fontSize="small" />
          Reply Queue ({queuedReplies.length})
        </Typography>
        <Button
          variant="contained"
          size="small"
          onClick={() => setIsOpen(!isOpen)}
          endIcon={isOpen ? <ExpandLessIcon /> : <ExpandMoreIcon />}
          sx={{
            background: 'linear-gradient(45deg, #2196F3 30%, #21CBF3 90%)',
            boxShadow: '0 3px 5px 2px rgba(33, 203, 243, .3)',
            color: 'white',
            '&:hover': {
              background: 'linear-gradient(45deg, #2196F3 10%, #21CBF3 70%)',
            }
          }}
        >
          {isOpen ? 'Close' : 'Open'}
        </Button>
      </Box>

      <Collapse in={isOpen}>
        {queuedReplies.length === 0 ? (
          <Box sx={{ textAlign: 'center', py: 3 }}>
            <Typography color="text.secondary">No replies queued</Typography>
          </Box>
        ) : (
          <List sx={{ maxHeight: '75vh', overflow: 'auto' }}>
            {queuedReplies.map((reply) => (
              <ListItem key={reply.id} sx={{ px: 0 }}>
                <Card variant="outlined" sx={{ width: '100%' }}>
                  <CardContent>
                    <Box sx={{ display: 'flex', alignItems: 'center', gap: 1, mb: 1 }}>
                      <XIcon fontSize="small" />
                      <Typography variant="subtitle2">
                        {reply.username}
                      </Typography>
                    </Box>

                    <Typography variant="body2" color="text.secondary" sx={{ mb: 1 }}>
                      {reply.originalTweet}
                    </Typography>

                    <Typography variant="body2" sx={{ mb: 2 }}>
                      {reply.replyText}
                    </Typography>

                    <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
                      <Chip 
                        size="small" 
                        label={`Queued: ${new Date(reply.queuedAt).toLocaleString()}`}
                      />
                      <Button
                        size="small"
                        variant="contained"
                        startIcon={<SendIcon />}
                        onClick={() => handleSendReply(reply.id)}
                        disabled={sending.has(reply.id)}
                      >
                        {sending.has(reply.id) ? 'Sending...' : 'Send Now'}
                      </Button>
                    </Box>
                  </CardContent>
                </Card>
              </ListItem>
            ))}
          </List>
        )}
      </Collapse>
    </Paper>
  );
};

export default ReplyQueue;
